export const CarTool = () =>{

    const cars = [
        {id: 1, make: 'Lexus', model: 'NX 300', year: 2021, color: 'Atomic Silver', price: 53000},
        {id: 2, make: 'Tesla', model: 'Model 3', year: 2021, color: 'Red', price: 72000}
    ];

    const carListItems = cars.map(car => {
        return (
            <tr key={car.id}>
                <td>{car.id}</td>
                <td>{car.make}</td>
                <td>{car.model}</td>
                <td>{car.year}</td>
                <td>{car.color}</td>
                <td>{car.price}</td>
            </tr>
        );
    })

    console.log('****Cars****')
    console.log(cars);
    console.log('****Car List Items****')
    console.log(carListItems);

    return(
        <>
            <header>
                <h1>Car Tool</h1>
            </header>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>MAKE</th>
                        <th>MODEL</th>
                        <th>YEAR</th>
                        <th>COLOR</th>
                        <th>PRICE</th>
                    </tr>
                </thead>
                <tbody>
                    {cars.map(car => {
                                return (
                                    <tr key={car.id}>
                                        <td>{car.id}</td>
                                        <td>{car.make}</td>
                                        <td>{car.model}</td>
                                        <td>{car.year}</td>
                                        <td>{car.color}</td>
                                        <td>{car.price}</td>
                                    </tr>
                                );
                            })
                    }
                </tbody>
            </table>
        </>
    )
};
